import React from "react";
import SportCard from "../components/SportCard";

export default function Sports({ books }) {
  const imgData = [
    `data:image/jpeg;base64,`,
    "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.amazon.com.tr%2FUnbroken-Resilience-Redemption-Hardcover-Hillenbrand%2Fdp%2F1400064163&psig=AOvVaw1fzk4U7ZDza8cAz29n8d_p&ust=1685446424758000&source=images&cd=vfe&ved=0CBEQjRxqGAoTCPij-K23mv8CFQAAAAAdAAAAABCOAQ",
    "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.imdb.com%2Ftitle%2Ftt1809398%2F&psig=AOvVaw1fzk4U7ZDza8cAz29n8d_p&ust=1685446424758000&source=images&cd=vfe&ved=0CBEQjRxqGAoTCPij-K23mv8CFQAAAAAdAAAAABCaAQ",
  ];
  return (
    <>
      {/* {setInterval(() => {
        console.log(Math.floor(Math.random() * 3 + 0));
      }, 100)} */}
      {console.log(imgData[1])}
      <h2>Sports</h2>
      {books && (
        <div className="card-list">
          {books.map((book) => (
            <SportCard
              src={imgData[0]}
              bookName={book.bookName}
              author={book.author}
            />
          ))}
        </div>
      )}
    </>
  );
}
